var JSONFackerTemplate = (function () {
    function JSONFackerTemplate() {
    }
    JSONFackerTemplate.getCallingArgs = //static fixJsonArguments( json:string ):string { return ['"', json.split(',').map((el)=>{return (el.replace(/^\'(.*)\'$/, "\"$1\"").replace(/^\"(.*)\"$/, "$1").replace(/\"/g, '\\"')); }).join('","'), '"'].join(''); }
    function (args) {
        var params = args.match(/\((.*)\)/);

        // create
        var sandbox = { code: null };

        try  {
            vm.runInNewContext('code = [' + params[1].replace(/\'/g, '"') + ']', sandbox);
        } catch (e) {
            return [];
        }

        return sandbox.code;
    };

    JSONFackerTemplate.render = /**
    * Replaces every {{variable}} inside the template with values provided by view
    * @param template {string} the template containing one or more {{key}}
    * @param view {object} an object containing string (or number) values for every key that is used in the template
    * @return {string} template with its valid variable names replaced with corresponding values
    */
    function (template, view, jsmocker) {
        if (typeof view === "undefined") { view = {}; }
        if (typeof jsmocker === "undefined") { jsmocker = null; }
        return template.replace(/\{?\{\{\s*(.*?)\s*\}\}\}?/g, function (match, varName) {
            var methodName = varName.replace(/\(.*\)/, '');

            if (jsmocker) {
                if (jsmocker.templateObject) {
                    if (typeof jsmocker.templateObject[methodName] == "function") {
                        if (jsmocker.injector.hasDependencies(jsmocker.templateObject[methodName])) {
                            var args = varName.match(/\(.*\)/);
                            var params;

                            // determine if arguments are passed to the method
                            args && args[0] && (params = JSONFackerTemplate.getCallingArgs(args[0]));

                            if (params)
                                return jsmocker.injector.processCall(jsmocker.templateObject[methodName], params);

                            // process normal injected function
                            return jsmocker.injector.process(jsmocker.templateObject[methodName]);
                        }
                    }
                }
            }

            if (typeof DataFackerHelper[methodName] == "function") {
                var args = varName.match(/\(.*\)/);
                var params;

                //args && args[0] && ( params = JSON.parse('[' + JSONFackerTemplate.fixJsonArguments( args[0].replace(/[\(\)]/g, '')) + ']'));
                args && args[0] && (params = JSONFackerTemplate.getCallingArgs(args[0]));

                return (methodName == varName ? DataFackerHelper[varName]() : DataFackerHelper[methodName].apply(null, params));
            }

            var value = view[varName];
            switch (typeof value) {
                case 'string':
                case 'number':
                case 'boolean':
                    return value;
                default:
                    //anything else will be replaced with an empty string. This includes object, array and null.
                    return '';
            }
        });
    };
    return JSONFackerTemplate;
})();

