var Base64 = (function () {
    function Base64() {
    }
    Base64.encode = function (stringToEncode) {
        return Base64.isNode ? new Buffer(stringToEncode, 'utf8').toString('base64') : window.btoa(stringToEncode);
    };

    Base64.decode = function (buffer) {
        return new Buffer(buffer, 'base64');
    };
    Base64.isNode = typeof global !== "undefined" && {}.toString.call(global) == '[object global]';
    return Base64;
})();

